        open protected fun visitExprSearchedCase(node: PartiqlBasic.Expr.SearchedCase, accumulator: T): T = accumulator
        open protected fun visitExprStruct(node: PartiqlBasic.Expr.Struct, accumulator: T): T = accumulator
